	vector<string> findRelativeRanks(vector<int>& nums) {


		priority_queue< pair<int, int> > pri_queue;

		int length = (int)nums.size();
		for (int i = 0; i < length; i++) {
			pri_queue.push(make_pair(nums[i], i));
		}

		vector<string> result(length, "");
		int index = 0;
		char c[c_length];
		memset(c, '\0', c_length);
		while (!pri_queue.empty()) {
			pair<int, int> tmp = pri_queue.top();
	//		cout << tmp.first << " - " << tmp.second << endl;
			if (index < 3) {
				result[tmp.second] = s[index];
			} else {
				memset(c, '\0', c_length);
				sprintf(c, "%d", index + 1);
				result[tmp.second] = c;
			}
			index++;
			pri_queue.pop();
		}

		return result;
	}
private:
	int c_length;
    string s[3];
